import React from "react";
import ol from "ol";

const Map = () => {
  var map = new ol.Map({
    target: "map",
    layers: [
      new ol.layer.Tile({
        source: new ol.source.OSM(),
      }),
    ],
    view: new ol.View({
      center: ol.proj.fromLonLat([37.41, 8.82]),
      zoom: 4,
    }),
  });
  return (
    <>
      <h2>My Map</h2>
      <div id="map" class="map">
        {map}
      </div>
    </>
  );
};

export default Map;
